function MenuItem(props) {
     const item = props.item;
     const select = props.setSelected;
     return (
          <div key={item.id} className='menu_item'>
               <div className='menuItemText' onClick={select(true)}>
                    {props.food}
               </div>
          </div>
     );
}

export default MenuItem;
